import fetcher from "../fetchers/axios-fetcher"
import useSWR from 'swr'

export default function useCategories()
{
    const {data, error, isLoading} = useSWR("http://localhost:8000/api/categories/", fetcher)
    console.log(``)
    return {
        categories : data,
        error,
        isLoading
    }
}
